- input: "TEXT\x1CC00541482\x1C.TEXT\x1C\x1CF3A\x1CAccidentily, the expenditures in
    our April 15 Quarterly Report were entered with a negative value. The subtraction
    of the negative value of the expenditures accidentily created a double negative.
    Therefore, when subtracted from revenue, created an incorrect positive value overstating
    our cash on hand by double the amount of the expenditures. As soon as we discovered
    this error we reported it to the FEC and within the same day we are filing this
    amendment to correct the error.\n"
